    data: |
      SELECT DISTINCT - col0 / 51 + + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 + + 64 - col0 + - 90 * + col1 IS NOT NULL;
  - name: tab0

outputs:
